PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?person ?dod ?archive_inst WHERE {
  ?person wdt:P21 wd:Q6581072 ; wdt:P570 ?dod ; wdt:P31 wd:Q5 .
  FILTER ( ?dod < "1948-01-01T00:00:00Z" ^^ xsd:dateTime ) {
    ?person wdt:P19 ?place .
    ?place wdt:P131 * wd:Q3240 .
  } UNION {
    ?person wdt:P20 ?place2 .
    ?place2 wdt:P131 * wd:Q3240 .
  }
  OPTIONAL {
    ?person p:P485 / ps:P485 ?archive_inst .
  }
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT DISTINCT ?person ?networth ?unit ?conversion ?networth_usd WHERE {
  ?person wdt:P31 wd:Q5 ; wdt:P21 wd:Q6581072 .
  ?person p:P2218 ?st .
  ?st ps:P2218 ?networth .
  OPTIONAL {
    ?st pq:P38 ?unit .
  }
  OPTIONAL {
    ?st pq:P2284 ?conversion .
  }
  BIND( IF( bound( ?unit ) && ?unit = wd:Q4917 , 1 , IF( bound( ?conversion ) , ?conversion , 1 ) ) AS ?conv ) BIND( xsd:decimal ( ?networth ) * xsd:decimal ( ?conv ) AS ?networth_usd ) FILTER ( ?networth_usd >= 1000000000 )
}
ORDER BY DESC ( ?networth_usd )

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?numPartners ( SUM( IF( ?gender = wd:Q6581072 , 1 , 0 ) ) AS ?numFemale ) ( SUM( IF( ?gender = wd:Q6581097 , 1 , 0 ) ) AS ?numMale ) WHERE {
  ?artist wdt:P106 / wdt:P279 * wd:Q108289408 .
  ?artist wdt:P21 ?gender .
  FILTER ( ?gender IN ( wd:Q6581097 , wd:Q6581072 ) ) OPTIONAL {
    ?artist wdt:P451 ?partner
  }
  BIND( COUNT( DISTINCT ?partner ) AS ?numPartners )
}
GROUP BY ?numPartners

