PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?mountain ?elevation ?mountainLabel WHERE {
  ?mountain wdt:P31 / wdt:P279 * wd:Q8502 .
  ?mountain wdt:P2044 ?elevation .
  FILTER ( ?elevation > 8000 ) OPTIONAL {
    ?mountain wdt:P376 ?body
  }
  FILTER ( ! BOUND( ?body ) || ?body = wd:Q2 ) OPTIONAL {
    ?mountain rdfs:label ?mountainLabel FILTER ( LANG( ?mountainLabel ) = "en" )
  }
}
ORDER BY DESC ( ?elevation )
LIMIT 20

