PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?institution ( COUNT( DISTINCT ?thesis ) AS ?thesisCount ) ( SAMPLE( ?label ) AS ?institutionLabel ) WHERE {
  ?thesis wdt:P31 / wdt:P279 * ?thesisType .
  VALUES ?thesisType {
    wd:Q1266946 wd:Q3030630
  }
  ?thesis wdt:P4101 ?institution .
  OPTIONAL {
    ?institution rdfs:label ?label FILTER ( LANG( ?label ) = "en" )
  }
}
GROUP BY ?institution
ORDER BY DESC ( ?thesisCount )
LIMIT 50

