PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?type ( COUNT( DISTINCT ?org ) AS ?orgCount ) WHERE {
  ?org wdt:P31 / wdt:P279 * wd:Q43229 .
  {
    ?org wdt:P131 + wd:Q5765 .
  } UNION {
    ?org wdt:P159 wd:Q5765 .
  }
  ?org wdt:P31 ?type .
}
GROUP BY ?type
