PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?category ?label ( SUM( ?unitCount ) AS ?totalUnits ) WHERE {
  {
    SELECT ( IF( ?unitCount > 499 , STR( ?legalForm ) , "OTHER" ) AS ?category ) ( IF( ?unitCount > 499 , ?frLabel , "AUTRES" @fr ) AS ?label ) ?unitCount WHERE {
      {
        SELECT ?legalForm ( COUNT( ?unit ) AS ?unitCount ) ( SAMPLE( ?labelInner ) AS ?frLabel ) WHERE {
          ?legalForm wdt:P31 wd:Q56427813 .
          ?unit wdt:P1454 ?legalForm ; wdt:P17 wd:Q142 .
          OPTIONAL {
            ?legalForm rdfs:label ?labelInner .
            FILTER ( LANG( ?labelInner ) = "fr" )
          }
        }
        GROUP BY ?legalForm
      }
    }
  }
}
GROUP BY ?category ?label
ORDER BY DESC ( ?totalUnits )

PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX geof: <http://www.opengis.net/def/function/geosparql/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?settlement ?settlementCoord ?distance ?centerCoord WHERE {
  VALUES ?type {
    wd:Q532 wd:Q3957
  }
  ?settlement wdt:P31 ?type ; wdt:P17 wd:Q213 ; wdt:P625 ?settlementCoord .
  BIND( "Point(14.644975 49.534590)" ^^ geo:wktLiteral AS ?centerCoord ) BIND( geof:distance ( ?settlementCoord , ?centerCoord ) AS ?distance ) FILTER ( ?distance <= 35 )
}
ORDER BY ?distance
LIMIT 100

