    wd:Q482980 wd:Q36180 wd:Q6625963 wd:Q49757 wd:Q214917
  }
  ?person wdt:P27 wd:Q30 .
  ?person wdt:P19 ?birthplace .
  ?birthplace wdt:P131 * wd:Q771 .
  ?person wdt:P569 ?dob .
  FILTER ( ?dob > "1919-12-31T00:00:00Z" ^^ xsd:dateTime ) FILTER NOT EXISTS {
    ?person wdt:P570 ?dod
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( LANG( ?personLabel ) = "en" )
  }
  OPTIONAL {
    ?birthplace rdfs:label ?birthplaceLabel FILTER ( LANG( ?birthplaceLabel ) = "en" )
  }
}
