  OPTIONAL {
    ?item wdt:P18 ?image .
  }
  ?creator wdt:P19 ?creatorBirthPlace .
  ?creatorBirthPlace wdt:P131 + wd:Q12130 .
}

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?constituency ( COUNT( DISTINCT ?mp ) AS ?actualSeats ) ?expectedSeats ( SAMPLE( ?constLabel ) AS ?constituencyLabel ) WHERE {
  ?mp p:P39 ?statement .
  ?statement ps:P39 wd:Q41582584 ; pq:P2937 wd:Q21084449 ; pq:P768 ?constituency .
  OPTIONAL {
    ?constituency wdt:P1342 ?expectedSeats
  }
  OPTIONAL {
    ?constituency rdfs:label ?constLabel FILTER ( LANG( ?constLabel ) = "en" )
  }
}
GROUP BY ?constituency ?expectedSeats
HAVING ( COUNT( DISTINCT ?mp ) > 1 )
ORDER BY DESC ( ?actualSeats )

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
