    ?person wdt:P19 ?pob .
  }
  OPTIONAL {
    ?person wdt:P21 ?gender .
  }
  OPTIONAL {
    ?statement pq:P580 ?start .
  }
  OPTIONAL {
    ?statement pq:P582 ?end .
