PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wikibase: <http://wikiba.se/ontology#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX psv: <http://www.wikidata.org/prop/statement/value/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?company ?companyLabel ?revenue ?revenueUnit ?revenueDate ?netProfit ?profitMargin ?hq ?hqLabel WHERE {
  ?company wdt:P31 / wdt:P279 * wd:Q4830453 ; wdt:P159 ?hq .
  ?hq wdt:P17 wd:Q213 .
  FILTER ( ?company NOT IN ( wd:Q100707321 , wd:Q12021780 ) ) ?company p:P2139 ?revenueStatement .
  ?revenueStatement psv:P2139 ?revenueValueNode .
  ?revenueValueNode wikibase:quantityAmount ?revenue .
  FILTER ( ?revenue > 0 ) OPTIONAL {
    ?revenueValueNode wikibase:quantityUnit ?revenueUnit .
  }
  OPTIONAL {
    ?revenueStatement pq:P585 ?revenueDate .
  }
  ?company p:P2295 ?profitStatement .
  ?profitStatement psv:P2295 ?profitValueNode .
  ?profitValueNode wikibase:quantityAmount ?netProfit .
  BIND( ROUND( ( ?netProfit / ?revenue ) * 10000 ) / 100 AS ?profitMargin ) OPTIONAL {
    ?company rdfs:label ?companyLabel FILTER ( LANG( ?companyLabel ) = "en" )
  }
  OPTIONAL {
    ?hq rdfs:label ?hqLabel FILTER ( LANG( ?hqLabel ) = "en" )
  }
}
ORDER BY ASC ( ?profitMargin )
LIMIT 20

PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
